translated_text:
Levantine Arabic: ومن الموضوعات التانية اللي تمت تغطيتا بحسب ما ورد، حالة القدس المستقبلية المقدسة لدى الشعبين وقضية وادي الأردن. 
English:
The following are the topics covered in the report:
The future of Jerusalem as a holy city for the Jewish and Christian peoples;
The future of the Jordan Valley as a holy place for the Jewish and Christian peoples;
The future of the Holy Land as a holy place for the Jewish and Christian peoples;
The future of the Palestinian territories as a holy place for the Jewish and Christian peoples;
The future of the Arab territories as a holy place for the Jewish and Christian peoples;
